class.neirong@html
<js>
m=[];
n=[];
p=[];
//Âä†ÂÖ•ÊõøÊç¢ÈòüÂàó
function x(a,b) {
	m.push(a);
	n.push(b);
	p.push(null);
}
function(a,b,c){
	m.push(a);
	n.push(b);
	p.push(c);
}
//clear
function c() {
	m=[];
 	n=[];	
 	p=[];
}
//excute
function e(debug){
	for(i in n) {
		result=result.replace(m[i],n[i]);
	}
	if(debug) {
		java.log(debug);
		java.log(result);
	}
	c();
}

if(/Undefined/.exec(result)){
	result= "<br>„ÄÄ„ÄÄÁΩëÁ´ôÂàÜÈ°µÂêéÁ¨¨‰∏âÈ°µÊúâÊó∂ÊúâÈóÆÈ¢ò‰∏çÂèØÁî®ÔºåÈÄüÂ∫¶ÊÖ¢ÁöÑÊó∂ÂÄôÂ∞±‰ºöÊòØÁé∞Âú®ËøôÊ†∑‰∫ÜÔºåÁΩëÁ´ôÈÄüÂ∫¶Âø´ÁöÑÊó∂ÂÄôÂ∞±Ê≤°‰∫ã‰∫Ü„ÄÇ<br>„ÄÄ„ÄÄÊç¢‰∏™Êó∂Èó¥Âà∑Êñ∞ËØïËØïÔºÅÔºÅÔºÅ<br>„ÄÄ„ÄÄÊç¢‰∏™Êó∂Èó¥Âà∑Êñ∞ËØïËØïÔºÅÔºÅÔºÅ<br>„ÄÄ„ÄÄÊç¢‰∏™Êó∂Èó¥Âà∑Êñ∞ËØïËØïÔºÅÔºÅÔºÅ<br>" + result;
}
//ËΩ¨Êç¢Á©∫Ê†º
x(/[ \t]+</g,'<');
x(/&nbsp;/g,' ');
//ÂàùÂßãÂåñÂàÜÊÆµÂáÜÂ§á
x(/[\t ]{2,2}/g,"„ÄÄ");
//ÂàùÂßãÂåñÂõæÁâáÈìæÊé•
x(/[\r\n]?[\t ]*<img .+?toimg\/data\/([^\.]+)[^>]+>[\t ]*[\r\n]?/g,"#$1#");


//ÂéªÊéâÊ†áÁ≠æÈáåÁöÑÂ±ûÊÄß
x(/(\<|&lt;)([^\>]*?)(\s|&nbsp;)[^\>]*(\>|&gt;)/g,"<$2>");
//ÂéªÊéâË∂ÖÈìæÊé•
x(/\<a\>[^\>]+\>/gi,"");
x(/\<script\>[^\>]+\>/gi,"");
//Ë∞ÉÊï¥ÊéíÁâà
x(/\s*(<br>)?\s*„ÄÄ{2,}/gi,"</p>\r\n<p>");
x(/\s*[\r\n]?\s*<div[^\>]+\>\s*[\r\n]\s*/gi,"</p>\r\n<p>");

//ÂéªÊéâ‰∏çÈúÄË¶ÅÁöÑÊ†áÁ≠æ
x(/[\r\n]?\<([^\/p][^\<\>]*)?\>[\r\n]?/gi,"");
x(/[\r\n]?\<\/([^p][^\<\>]*)?\>[\r\n]?/gi,"");
//‰π±Á†ÅÂà†Èô§
x(/(^\s+)|(\s+)$|(\s+)[\r\n]/gi,"");
x(/(^|[\r\n])(<p>)?[^><]*(\>|&gt;)/gi,"$2");
x(/<p>\s*o([\r\n]|$)/g,'');


//ÂºÄÂ§¥ÊòØÂê¶ÂåÖÂê´ÊÆµËêΩÊà™Êñ≠Ê†áËØÜ
x(/^(?!(\<p\>))/i,"$1hereispagebreak");

//ÊâßË°åÊõøÊç¢Ôºå‰∏çËÉΩÂà†
e();


//ÊµãËØï‰∏≠Ôºå‰∏ãÈù¢ÁöÑe();‰∏çË¶ÅÊâìÂºÄ
x(/‚Äò/g,"„Äé");
x(/‚Äô/g,"„Äè");
x(/‚Äú/g,"„Äå");
x(/‚Äù/g,"„Äç");

e("1111111111111111111111111111111111111111111111111111111111111111111111111111");
result;
